{
	"name": "esbuild-loader",
	"version": "0.0.0-semantic-release",
	"description": "⚡️ Speed up your Webpack build with esbuild",
	"keywords": [
		"esbuild",
		"webpack",
		"loader",
		"typescript",
		"esnext"
	],
	"license": "MIT",
	"repository": "privatenumber/esbuild-loader",
	"funding": "https://github.com/privatenumber/esbuild-loader?sponsor=1",
	"author": {
		"name": "Hiroki Osame",
		"email": "hiroki.osame@gmail.com"
	},
	"files": [
		"dist"
	],
	"type": "module",
	"main": "./dist/index.cjs",
	"types": "./dist/index.d.cts",
	"exports": {
		".": {
			"types": "./dist/index.d.cts",
			"default": "./dist/index.cjs"
		},
		"./package.json": "./package.json"
	},
	"imports": {
		"#esbuild-loader": {
			"types": "./src/index.d.ts",
			"development": "./src/index.ts",
			"default": "./dist/index.cjs"
		}
	},
	"scripts": {
		"build": "pkgroll --target=node16.19.0",
		"test": "tsx --env-file=.env tests",
		"dev": "tsx watch --env-file=.env --conditions=development tests",
		"lint": "lintroll --cache .",
		"type-check": "tsc --noEmit",
		"prepack": "pnpm build && clean-pkg-json"
	},
	"peerDependencies": {
		"webpack": "^4.40.0 || ^5.0.0"
	},
	"dependencies": {
		"esbuild": "^0.21.0",
		"get-tsconfig": "^4.7.0",
		"loader-utils": "^2.0.4",
		"webpack-sources": "^1.4.3"
	},
	"devDependencies": {
		"@types/loader-utils": "^2.0.3",
		"@types/mini-css-extract-plugin": "2.4.0",
		"@types/node": "^18.13.0",
		"@types/webpack": "^4.41.33",
		"@types/webpack-sources": "^0.1.9",
		"clean-pkg-json": "^1.2.0",
		"css-loader": "^5.2.7",
		"execa": "^8.0.1",
		"fs-fixture": "^2.4.0",
		"lintroll": "^1.6.1",
		"manten": "^1.3.0",
		"memfs": "^4.9.3",
		"mini-css-extract-plugin": "^1.6.2",
		"pkgroll": "^2.1.1",
		"tsx": "^4.15.6",
		"typescript": "^5.4.5",
		"webpack": "^4.44.2",
		"webpack-cli": "^4.10.0",
		"webpack-merge": "^5.9.0",
		"webpack-test-utils": "^2.1.0",
		"webpack5": "npm:webpack@^5.0.0"
	},
	"pnpm": {
		"overrides": {
			"fsevents@1": "^2.0.0"
		}
	},
	"packageManager": "pnpm@9.2.0"
}

